import React from 'react';
import {
  Box,
  UnorderedList,
  ListItem,
  ModalBody,
  Image,
  Button,
  Link,
  useColorModeValue,
} from '@chakra-ui/react';

import { BsFileEarmarkCode, BsPlay } from 'react-icons/bs';

const CodeIt = () => {
  const firstColor = useColorModeValue('red', 'yellow');
  return (
    <Box mt={2}>
      <ModalBody>
        <Link
          as="Button"
          leftIcon={<BsPlay />}
          colorScheme={firstColor}
          size="lg"
          mr={5}
        >
          Try Now
        </Link>
        <Button leftIcon={<BsFileEarmarkCode />} colorScheme="blue" size="lg">
          View Source Code
        </Button>
        <br />
        <br />
        Hello, here is some content placeholer
      </ModalBody>
    </Box>
  );
};

export default CodeIt;
